using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Windows.Storage;
using Windows.UI.Xaml.Media.Imaging;

namespace Reborn_Zune_MusicLibraryService.Utility
{
    public class Utilities
    {
        public readonly static string NULL_THUMBNAIL_BASE64_STRING = "";

        public static BitmapImage GetBitmapImage(byte[] bytes)
        {
            if (bytes.Length == 0)
            {
                return new BitmapImage(new Uri("ms-appx:///Assets/Vap-logo-placeholder.jpg"));
            }
            else
            {
                using (MemoryStream mem = new MemoryStream(bytes, 0, bytes.Length))
                {
                    mem.Position = 0;
                    var Image = new BitmapImage();
                    Image.SetSource(mem.AsRandomAccessStream());
                    return Image;
                }
            }
        }

    }
    public class LibraryReturnContainer
    {
        public IReadOnlyList<StorageFile> files { get; set; }

        public bool isChanged { get; set; }

        public bool isFirstUse { get; set; }
    }

    
}
